@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("plus.google.com") {
  a {
    font-weight: 700;
    color: #255BA8 !important;
  }
  a:hover, a:focus {
    color: #DB4437 !important;
  }
  
  /* Logo*/
  .xdjHt.ex5ZEb {
    background-image: none !important;
    
  }
  .xdjHt.FYQzvb {
    opacity: 1 !important;
    position: relative;
  }
  
  .xdjHt.FYQzvb.ex5ZEb:before {
    content: 'Google+';
    position: absolute;
    top: -15px;
    width: 88px;
    font-size: 26px;
    letter-spacing: -0.05em;
    font-weight: 600;
    color: #DB4437;
    /*color: #FFF; */
  }
  /* Andere Schrift */
    body {
        font-family: 'Open Sans';
    }
  /* anderer Hintergrund / Farbe */
  .Jvazdb {
    /* #E5E3E0 = Sandfarbe */
    background: #E5E3E0 none repeat scroll 0 0;
    
  }
  /* menu left side */
  .u5oEgd {
    top: 30px;
  }
  /* kill the red clown */
    .XS1fT {
        background-color: #464646;
        color: #FFFFFF;
       font-size: 16px; /* icons etwas kleiner */
    }
  /* header schrumpfen */
  .ecJEib .rDQqN ,
  .ecJEib .FGhx7c {
    height: 40px;
  }
  .YRgYyc {
    height: 28px;
  }
  /* search bar neu stylen */
  .jvJyyb {
    height: 90%;
  }
  .EPPZeb {
    background-color: rgba(255, 255, 255, 0.2) !important;
    max-height: 100%;
  }
  .f81Q3b {
    width: auto;
    max-width: 420px;
  }
  .IaFzsc {
    height: auto;
  }
  /* quick search result window*/
  .IaFzsc .jBmls {
    top: 40px;
  }

  /* warum haben diese Buttons eigentlich den falschen Cursor? */
  /* was ist das für ein scheiß-selektor bitte? aber die seite bzw selektoren sind ja eh alle generiert. deswegen ist da auch alles kaputt und langsam wie hölle. */
  #gb#gb a.gb_b {
    cursor: pointer;
  }
  /* glocki mehr aufmerksamkeit, wenn das js dazu mal funktionieren würde, wäer das auch zuverlässig so ... */
/**/
    a.gb_b[aria-label] {
    margin-left: -5px;
    margin-top: -5px;
  }
  a.gb_b[aria-label] div {
    background-color: #DB4437 !important;
    color: #FFF !important;
    height: 30px;
    width: 30px;
    line-height: 30px;
    /*background-position: 3px -416px !important;*/
  }
  a.gb_b[aria-label^='0'] {
    margin: 0;
  }
  a.gb_b[aria-label^='0'] div {
    background-color: #FFFFFF !important;
    color: #404040 !important;
    margin: 0;
    background-repeat: no-repeat;
    background-position: -32px -208px !important;
  }
  /**/
  /* etwas nettere Überschriften */
    .Tuxepf {
        font-family: 'Open Sans Condensed';
        font-weight: 700;
        font-size: 16px;
    }
  /* Alt Text ein wenig verbessern */
    img {
      font-family: 'Open Sans Condensed';
      font-weight: 700;
      font-size: 16px;
      text-indent: 2rem;
    }
  /* neue Beiträge Hinweis verschieben */
    .GyPXQ {
       left: 30%;
    
    }
   /* alle Beiträge ausklappen */
	  .qhIQqf {
       max-height: inherit !important;
    }
    .qhIQqf::after {
      display: none !important;
    }
  
  /* Breite der Posts erhöhen */
  .hJzldf,
  .nWGHWc.k7iNHb .jxKp7 {
    max-width: 620px !important;
    width: 100% !important;
  }
  .jxKp7.H68wj,
  .GcESAf {
    max-width: 620px !important;
  }
  .nWGHWc.jxKp7.H68wj {
    max-width: 620px !important;
    width: 100% !important;
  }
  /* kommentare ausklappen */
  .LZOeXd {
    position: relative !important;
    height: initial !important;
    min-height: initial !important;
    overflow-x: hidden;
    overflow-y: hidden;
    background: rgba(0, 0, 0, 0.05) !important;
  }
  .LZOeXd [jsname="LuJ5kc"] {
    position: relative !important;
    display: flex;
    flex-direction: column;
    flex-wrap: nowrap;
    justify-content: flex-start;
    align-content: flex-start;
    align-items: stretch;
  }
  .LZOeXd:after {
    content: '...';
    font-family: Arial, sans-serif;
    font-size: 12px;
    font-weight: 900;
    display: block;
    z-index: 1000;
    position: absolute;
    bottom: 0em;
    left: 0;
    width: auto;
    height: 2em;
    text-align: right;
    right: 1em;
    cursor: pointer;
  }
  .LZOeXd .X865Z {
    position: relative !important;
    opacity: 1 !important;
    display:flex !important;
    margin-bottom: 5px;
    bottom: initial !important;
    top: initial !important;
    left: initial !important;
    right: initial !important;
    padding: 5px 2%;
  }
  .LZOeXd .SVRkP {
    text-overflow: initial; 
    max-height: initial;
    padding-right: 5%;
  }
  
  .Tq8tEc  {
    display: flex !important;
    flex-direction: row;
    flex-wrap: nowrap;
    justify-content: flex-start;
    align-content: space-between;
    align-items: flex-start;
    opacity: 1 !important;
    position: relative !important;
    padding: 10px;
  }
  .QS1Czf {
    flex: 1 1 auto;
    max-height: inherit;
  }
  .vGowKb {
    font-family: 'Open Sans Condensed';
    font-weight: 700;
  }
  
  
  /* stick new posts button really to the top*/
  .GyPXQ {
    transform: translate(0) !important;
  }
  
  /* better readability of plusses given */
  .iOAN1d {
    font-weight: 600;
    color: #FFF !important;
    border-radius: 50%;
    background-color: #b93221;
    flex-grow:0 !important;
    padding: 0 2px;
  }
  
  /* fix domain-text over meme's, thanks Peter Lemken for the tip! */
  .g0644c {
    opacity: 0 !important;
    transition: opacity 0.5s ease-out;
  }
  .rr9Dof:hover .g0644c {
    opacity: 1 !important;
  }
  /* and the same for comments-pics please */
  .MQS1Ue {
    opacity: 0 !important;
    transition: opacity 0.5s ease-out;
  }
  .is2Add:hover .MQS1Ue {
    opacity: 1 !important;
  }
  /* Discover */
  .EVayJf {
    color: #FFF !important;
  }
  .Tuxepf {
    /* link symbol for direct external links */
  }
